import React from "react";
import { useTranslation } from "react-i18next";
import { CustomToolbar } from "Components/";

function LandingPage() {
  const { t } = useTranslation();
  return (
    <CustomToolbar
      title={t("title")}
      options={[
        t("nav"),
        t("nav.services"),
        t("nav.projects"),
        t("nav.careers"),
        t("nav.contact")
      ]}
    />
  );
}

export default LandingPage;
